const stateDefault = {
  arrImg: [{}],
};

export const CarouselReducer = (state = stateDefault, action) => {
  switch (action.type) {
    case "SET_CAROUSEL":
      state.arrImg = action.arrImg;
      return { ...state };

    default:
      return { ...state };
  }
};
